import React, { Component } from 'react'
import Navbar from '../Navbar'
import Header from '../Header'
import Fffooter from '../Fffooter'

export class AllAbout extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Header />


        <Fffooter />
      </div>
    )
  }
}

export default AllAbout
